import { memo } from "react";

export const procesoPesado = memo((iteraciones) => {
    for (let i = 0; i < iteraciones; i++) {
        console.log(iteraciones, ' Ahi vamos desde aca...');
        return `${iteraciones} iteraciones realizadas desde aca`;
    }
})
